import React from "react";
import Todo from './todo';
import "./index.css";

function App() {
  return <div id="todoapp">
    <div class="title">
      <h1>todo</h1>
    </div>
    <div id="create-todo">
      <Todo />
    </div>
  </div>
}
export default App;
